import styled from "styled-components";
import MainSecIconsService from "./MainSecIconsService"


const SectionCTA = styled.section`
    width: 100%;

    display: flex;
    flex-wrap: wrap;
    justify-content: center;
`;

function Section06() {
    return (
        <SectionCTA>
            <MainSecIconsService />
        </SectionCTA>
    )
};

export default Section06;
